import React from "react";
import { BrowserRouter, Link } from "react-router-dom";

const Loginbox = () => {
  return (
    <div>
      <h2>Welcome Back</h2>

      <Link to="../App">
        <button>Sign in</button>
      </Link>
    </div>
  );
};

export default Loginbox;
